import React, { useState, useEffect } from "react";

const FeaturedProperties = () => {
  const [properties, setProperties] = useState([]);
  const [clicked, setClicked] = useState(false);

  useEffect(() => {
    fetch("https://68b826bcb715405043274639.mockapi.io/api/properties/PropertyListing")
      .then((res) => res.json())
      .then((data) => setProperties(data))
      .catch((err) => console.error(err));
  }, []);

  const handleButtonClick = () => setClicked(!clicked);

  return (
    <div style={{ padding: "20px", fontFamily: "Arial, sans-serif" }}>
      {/* Top bar */}
      <div
        style={{
          display: "flex",
          justifyContent: "space-between",
          alignItems: "center",
          marginBottom: "20px",
        }}
      >
        <h2 style={{ margin: 0 }}>Featured Property</h2>
        <button
          onClick={handleButtonClick}
          style={{
            padding: "10px 20px",
            backgroundColor: clicked ? "blue" : "#eee",
            color: clicked ? "#fff" : "#000",
            border: "none",
            borderRadius: "5px",
            cursor: "pointer",
            display: "flex",
            alignItems: "center",
            gap: "5px",
          }}
        >
          See 268 new projects ‚û°
        </button>
      </div>

      {/* Properties grid */}
      <div
        style={{
          display: "flex",
          flexWrap: "wrap",
          gap: "20px",
          justifyContent: "center",
        }}
      >
        {properties.slice(0, 25).map((property) => (
          <div
            key={property.id}
            style={{
              position: "relative",
              width: "300px", // smaller width
              borderRadius: "10px",
              overflow: "hidden",
              boxShadow: "0 4px 10px rgba(0,0,0,0.1)",
              marginBottom: "40px",
            }}
          >
            {/* Image */}
            <img
              src={property.image}
              alt={property.name}
              style={{
                width: "100%",
                height: "200px",
                objectFit: "cover",
                display: "block",
              }}
            />

            {/* Info div (half on image, half below) */}
            <div
              style={{
                position: "absolute",
                bottom: "-40px",
                left: "0",
                width: "100%",
                backgroundColor: "#fff",
                padding: "15px",
                borderRadius: "0 0 10px 10px",
                boxShadow: "0 4px 10px rgba(0,0,0,0.1)",
                display: "flex",
                flexDirection: "column",
                gap: "10px",
              }}
            >
              {/* Top row: location + bookmark */}
              <div
                style={{
                  display: "flex",
                  justifyContent: "space-between",
                  alignItems: "flex-start",
                  gap: "10px",
                }}
              >
                <div>
                  <div style={{ display: "flex", alignItems: "center", gap: "5px" }}>
                    <span>üìç</span>
                    <span style={{ fontWeight: "bold" }}>
                      {property.city}, {property.state}
                    </span>
                  </div>
                  <p style={{ margin: "5px 0", fontSize: "12px", color: "#555" }}>
                    Lorem ipsum dolor sit amet, consectetur adipiscing elit.
                  </p>
                  <p style={{ margin: "0", fontSize: "12px", color: "#555" }}>
                    Sed do eiusmod tempor incididunt ut labore et dolore magna aliqua.
                  </p>
                </div>
                <div style={{ color: "blue", fontSize: "20px", cursor: "pointer" }}>üîñ</div>
              </div>

              {/* Bottom row: dollar + show more button */}
              <div
                style={{
                  display: "flex",
                  justifyContent: "space-between",
                  alignItems: "center",
                  marginTop: "10px",
                }}
              >
                <div style={{ fontWeight: "bold", fontSize: "16px" }}>üí≤ {property.buildingNumber}</div>
                <button
                  style={{
                    padding: "8px 15px",
                    backgroundColor: "blue",
                    color: "#fff",
                    border: "none",
                    borderRadius: "20px",
                    cursor: "pointer",
                  }}
                >
                  Show More
                </button>
              </div>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
};

export default FeaturedProperties;
